import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const ProfilePage = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [formData, setFormData] = useState({
    firstName: 'John',
    lastName: 'Doe',
    email: 'johndoe@example.com',
    nationalId: '123456789',
    university: 'Science',
    academicLevel: 'Level 3',
  });

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  return (
    <>
      <nav className="bg-gray-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10  hover:bg-white hover:border-b-2 border-black">
        <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
          <div className="flex justify-between items-center w-full md:w-auto">
            <Link to="/" className="text-yellow-500 text-4xl font-bold md:mb-0 mb-4 md:mb-0 hover:text-black">Even<span className="text-red-600">D</span>ango</Link>
            <button
              onClick={toggleDropdown}
              className="md:hidden text-yellow-500 hover:text-black focus:outline-none"
            >
              â˜°
            </button>
          </div>
          <ul className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${isOpen ? 'block' : 'hidden'}`}>
            <li><Link to="/home" className="text-yellow-600 hover:text-black m-2 font-blond">Home</Link></li>
            <li><Link to="/profile" className="text-yellow-600 hover:text-black m-2 font-blond">Profile</Link></li>
            <li><Link to="/about" className="text-yellow-600 hover:text-black m-2 font-blond">About</Link></li>
            <li><Link to="/contact" className="text-yellow-600 hover:text-black m-2 font-blond">Contact</Link></li>
          </ul>
        </div>
      </nav>

      <div class="grid gap-6 lg:grid-cols-3 lg:gap-10 xl:grid-cols-5">
  <div class="order-2 space-y-4 lg:order-1 lg:col-span-2 xl:col-span-1">
    <div class="flex items-center space-x-4">
      <div class="rounded-full overflow-hidden border-2 border-gray-100 dark:border-gray-800">
        <img
          src="/placeholder.svg"
          alt="User"
          width="80"
          height="80"
          class="rounded-full"
          style="aspect-ratio: 80 / 80; object-fit: cover;"
        />
      </div>
      <div class="space-y-1.5">
        <h1 class="text-2xl font-bold">Jane Doe</h1>
        <p class="text-sm text-gray-500 dark:text-gray-400">National ID: 1234567890</p>
      </div>
    </div>
    <div class="space-y-2">
      <div class="space-y-0.5">
        <h2 class="text-lg font-semibold">College</h2>
        <p class="text-sm text-gray-500 dark:text-gray-400">Example University</p>
      </div>
      <div class="space-y-0.5">
        <h2 class="text-lg font-semibold">Academic Level</h2>
        <p class="text-sm text-gray-500 dark:text-gray-400">Senior</p>
      </div>
      <div class="space-y-0.5">
        <h2 class="text-lg font-semibold">Email</h2>
        <p class="text-sm text-gray-500 dark:text-gray-400"></p>
      </div>
    </div>
  </div>
</div>
    </>
  );
};

export default ProfilePage;
